DROP TABLE IF EXISTS `bpm_exe_stack`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `bpm_exe_stack` (
  `stackId` bigint(20) NOT NULL,
  `actDefId` varchar(64) DEFAULT NULL COMMENT '流程定义ID',
  `nodeId` varchar(128) NOT NULL COMMENT '节点ID',
  `nodeName` varchar(256) DEFAULT NULL COMMENT '节点名',
  `startTime` datetime DEFAULT NULL COMMENT '开始时间',
  `endTime` datetime DEFAULT NULL COMMENT '结束时间',
  `assignees` varchar(1024) DEFAULT NULL COMMENT '执行人IDS，如1,2,3',
  `isMultiTask` smallint(6) DEFAULT NULL COMMENT '1=是\r\n            0=否',
  `parentId` bigint(20) DEFAULT NULL COMMENT '父ID',
  `actInstId` bigint(20) DEFAULT NULL,
  `taskIds` varchar(512) DEFAULT NULL,
  `nodePath` varchar(1024) DEFAULT NULL COMMENT '节点路径\r\n            格式如：\r\n            0.1.2.\r\n            其中2则为本行记录的主键值',
  `depth` int(11) DEFAULT NULL COMMENT '节点层',
  `taskToken` varchar(128) DEFAULT NULL COMMENT '是针对分发任务时，携带的令牌，方便查找其父任务堆栈',
  PRIMARY KEY (`stackId`),
  KEY `IDX_BPMSTACKINST_depth` (`actInstId`,`depth`),
  KEY `IDX_BPMSTACK_PARENTID` (`parentId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='流程执行堆栈树';
/*!40101 SET character_set_client = @saved_cs_client */;

