INSERT INTO `sys_inbox` VALUES ('10000005730017','2052751705','2014-09-17 08:16:38',NULL,NULL,0,0,'Foxmail发出的测试邮件','support@peisheyun.com','support@peisheyun.com','这是Foxmail在为您配置SMTP服务器时发出的测试邮件。','2014-08-29 10:50:29','',2052751705,0,'<201408291850290969031@Allan-Laptop>','support@peisheyun.com'),('10000005730018','2052751705','2014-09-17 08:16:38',NULL,NULL,0,0,'欢迎使用腾讯企业邮箱','\"=?gb2312?B?zNrRtsbz0rXTys/k08O7pw==?=\"','10000@qq.com','<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n	<title></title>\n<style type=\"text/css\">\nbody{background:#ECECEC;font-family:\"lucida Grande\",Verdana;}\n.invite{width:606px;margin:0 auto;overflow:hidden;}\n.invite, .invite td, .invite th{border-collapse:collapse;padding:0;vertical-align:middle;}\n.invite th{font-weight:bold;font-size:16px;color:white;text-align:left;background:#3B5999;}\n.invite th .mailLogo{margin:-2px 5px 0 0; padding:0 0 0 30px;}\n.invite th div{height:65px;overflow:hidden;}\n.invite .borderLeft{width:4px;*width:3px;border-left:1px solid #EBEBEB;border-right:1px solid #C9C9C9;background:#E9E9E9;}\n.invite .borderRight{width:3px;border-left:1px solid #C9C9C9;border-right:1px solid #EBEBEB;background:#E9E9E9;}\n.invite h2{margin:26px 34px 16px;font-size:18px;font-weight:bold;}\n.invite p{color:#313131;display:block;font-size:14px;line-height:150%;padding:1px 34px 21px;margin:0;}\n.invite p.team, .invite p.team a{color:#999999;text-decoration:none;}\n.invite p.team a:hover{color:#999999;text-decoration:underline;}\n.invite a{color:#3B5999}\n</style>\n</head>\n<body>\n<div style=\"background:#ECECEC;\">\n<table class=\"invite\" align=\"center\" bgcolor=\"#ffffff\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n	<tr>\n		<td colspan=\"4\" class=\"radius\" style=\"vertical-align:bottom;overflow:hidden;line-height:6px;font-size:0;\"><img src=\"http://exmail.qq.com/zh_CN/htmledition/images/newicon/sysmail/mail_invite_top.png\" alt=\"\" /></td>\n	</tr>\n	<tr>\n		<td rowspan=\"2\" class=\"border borderLeft\"></td>\n		<th width=\"416\"><img src=\"http://exmail.qq.com/zh_CN/htmledition/images/logo/logo_sysmail_biz_0.gif\" alt=\"mail企业邮箱\" class=\"mailLogo\"/>&nbsp;</th>\n		<th width=\"180\"><div><img src=\"http://exmail.qq.com/zh_CN/htmledition/images/bizmail/top_biz.gif\" class=\"mailBg\"/></div></th>\n		<td rowspan=\"2\" class=\"border borderRight\"></td>\n	</tr>\n	<tr>\n		<td colspan=\"2\">\n			<p style=\"margin-top:20px;\">客服，您好：</p>\n			<p>欢迎启用您的企业邮箱！</p>\n			<p>您可以收藏登录地址 <a href=\"http://exmail.qq.com/login\" target=\"_blank\">http://exmail.qq.com/login</a> 快速登录邮箱；或使用客户端管理邮件，查看<a href=\"http://service.exmail.qq.com/cgi-bin/help?subtype=1&&id=28&&no=1000564\" target=\"_blank\">设置方法</a>。</p>\n			<p>腾讯企业邮箱支持发送 50MB 普通附件，2GB 超大附件。我们还准备了：</p>\n			<p>\n			<img src=\"http://exmail.qq.com/zh_CN/htmledition/images/bizmail/icon_bindwx.png\" style=\"vertical-align:middle;margin-right:4px\" height=\"18\" width=\"18px\"/>\n			<strong>微信提醒</strong><br/>\n			<span style=\"margin-left:27px;\">微信助手帮您随时处理新来信、日程提醒，还能快捷查询同事联系方式 。<br/></span>\n			<span style=\"margin-left:27px;\">试试扫描二维码绑定微信？点击 <a href=\"https://exmail.qq.com/cgi-bin/setting_wxbind?action=get\" onclick=\"if(location.href.indexOf(\'file://\')==-1){location.href=\'/cgi-bin/setting_wxbind?action=get&sid=$SID$\';return false;}\">查看二维码</a></span>\n			</p>\n			<p>\n			<img src=\"http://exmail.qq.com/zh_CN/htmledition/images/bizmail/icon_bindqq.png\" style=\"vertical-align:middle;margin-right:4px\" height=\"18\" width=\"18px\"/>\n			<strong>绑定QQ</strong><br/>\n			<span style=\"margin-left:27px;\">想在QQ上接收邮件提醒？希望点击小信封一键登录邮箱？<br/></span>\n			<span style=\"margin-left:27px;\">现在 <a href=\"https://exmail.qq.com/cgi-bin/setting_remind?sid=$SID$&action=list\" onclick=\"if(location.href.indexOf(\'file://\')==-1){location.href=\'/cgi-bin/setting_remind?sid=$SID$&action=list\';return false;}\">绑定QQ</a>，让企业邮箱更方便快捷。</span>\n			</p>\n			<p>\n				<img src=\"http://exmail.qq.com/zh_CN/htmledition/images/bizmail/icon_exsfile.gif\" style=\"vertical-align:middle;margin-right:4px\" height=\"18\" width=\"18px\"/>\n				<strong>企业网盘</strong><br/>\n				<span style=\"margin-left:27px;\">与同事共享文档、照片变得更简单，只需上传到企业网盘轻松共享。</span>\n			</p>\n			\n			<p>\n				<img src=\"http://service.mail.qq.com/images/faq/foxmail_icon_16_blue.png\" style=\"vertical-align:middle;margin-right:4px\" height=\"18\" width=\"18px\"/>\n				<strong>专属客户端Foxmail</strong><br/>\n				<span style=\"margin-left:27px;\">Foxmail，帮你自动配置腾讯企业邮箱帐号，实时同步地址本、日历。<br/></span>\n				<span style=\"margin-left:27px;\">支持发送高达2G的超大附件，各类附件轻松送达。<a href=\"http://exmail.qq.com/cgi-bin/readtemplate?t=bizmail_foxmail_introduce\" target=\"_blank\">了解更多</a></span>\n			\n			<p style=\"margin-left:27px;\">\n				您还可了解腾讯企业邮箱<a href=\"http://exmail.qq.com/portal/product/function\" target=\"_blank\">更多实用功能</a>。\n			</p>\n			<p>\n				祝您使用愉快。如果有任何疑惑，欢迎与我们联系： <a href=\"mailto:bizsupport@qq.com\">bizsupport@qq.com</a> 。\n			</p>\n			<p class=\"team\">\n				腾讯企业邮箱<br />\n				<span style=\"background:#ddd;height:1px;width:100%;overflow:hidden;display:block;margin:2px 0;\"></span>\n				腾讯企业邮箱门户：<a href=\"http://exmail.qq.com\" target=\"_blank\">http://exmail.qq.com</a><br/>\n				企业邮箱帮助中心：<a href=\"http://service.exmail.qq.com\" target=\"_blank\">http://service.exmail.qq.com</a>	\n			</p>\n		</td>\n	</tr>\n	<tr>\n		<td colspan=\"4\"  style=\"vertical-align:top;line-height:5px;overflow:hidden;font-size:0;\"><img src=\"http://exmail.qq.com/zh_CN/htmledition/images/newicon/sysmail/mail_invite_bottom.png\" alt=\"\" /></td>\n	</tr>\n</table>\n</div>\n</body>\n</html>\n\r\n','2014-08-29 10:49:54','',2052751705,0,NULL,'support@peisheyun.com'),('10000005730019','2052751705','2014-09-17 08:22:05',NULL,NULL,0,0,'会议讨论安排','support@peisheyun.com','wangzhiyun999@163.com','<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\">\r\n<HTML><HEAD>\r\n<META content=\"text/html; charset=gb2312\" http-equiv=Content-Type>\r\n<META name=GENERATOR content=\"MSHTML 10.00.9200.17088\"><LINK rel=stylesheet \r\nhref=\"BLOCKQUOTE{margin-Top: 0px; margin-Bottom: 0px; margin-Left: 2em}\">\r\n<STYLE>BLOCKQUOTE {\r\n	MARGIN-BOTTOM: 0px; MARGIN-LEFT: 2em; MARGIN-TOP: 0px\r\n}\r\nOL {\r\n	MARGIN-BOTTOM: 0px; MARGIN-TOP: 0px\r\n}\r\nUL {\r\n	MARGIN-BOTTOM: 0px; MARGIN-TOP: 0px\r\n}\r\nDIV.FoxDiv20140917162043115860 {\r\n	FONT-SIZE: 10pt; FONT-FAMILY: VERDANA; COLOR: #000000; MARGIN: 10px\r\n}\r\nP {\r\n	MARGIN-BOTTOM: 0px; MARGIN-TOP: 0px\r\n}\r\nBODY {\r\n	FONT-SIZE: 10.5pt; FONT-FAMILY: 微软雅黑; COLOR: #000080; LINE-HEIGHT: 1.5\r\n}\r\n</STYLE>\r\n</HEAD>\r\n<BODY style=\"MARGIN: 10px\">\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<HR style=\"HEIGHT: 1px; WIDTH: 210px\" align=left color=#b5c4df SIZE=1>\r\n\r\n<DIV><SPAN>wangzhiyun999</SPAN></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV \r\nstyle=\"BORDER-TOP: #b5c4df 1pt solid; BORDER-RIGHT: medium none; BORDER-BOTTOM: medium none; PADDING-BOTTOM: 0cm; PADDING-TOP: 3pt; PADDING-LEFT: 0cm; BORDER-LEFT: medium none; PADDING-RIGHT: 0cm\">\r\n<DIV \r\nstyle=\"FONT-SIZE: 12px; BACKGROUND: #efefef; COLOR: #000000; PADDING-BOTTOM: 8px; PADDING-TOP: 8px; PADDING-LEFT: 8px; PADDING-RIGHT: 8px\">\r\n<DIV><B>发件人：</B>&nbsp;<A href=\"mailto:liuc@mail.tsinghua.edu.cn\">刘聪</A></DIV>\r\n<DIV><B>发送时间：</B>&nbsp;2014-09-10&nbsp;11:31</DIV>\r\n<DIV><B>收件人：</B>&nbsp;<A \r\nhref=\"mailto:wangzhiyun999@163.com\">wangzhiyun999</A></DIV>\r\n<DIV><B>抄送：</B>&nbsp;<A href=\"mailto:gsc15@tsinghua.edu.cn\">郭世纯</A>; <A \r\nhref=\"mailto:xyzhang@tsinghua.edu.cn\">张新钰</A></DIV>\r\n<DIV><B>主题：</B>&nbsp;会议讨论安排</DIV></DIV></DIV>\r\n<DIV>\r\n<DIV class=FoxDiv20140917162043115860>\r\n<META name=GENERATOR content=\"MSHTML 9.00.8112.16563\"><LINK rel=stylesheet \r\nhref=\"BLOCKQUOTE{margin-Top: 0px; margin-Bottom: 0px; margin-Left: 2em}\">\r\n<DIV><FONT size=2 face=Verdana>王总，您好！</FONT></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;&nbsp;&nbsp;&nbsp; 随信附上我在今天讨论会前简单罗列的一些问题，您在设计表结构时可以综合考虑。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;&nbsp;&nbsp;&nbsp; 后续工作安排：</DIV>\r\n<DIV>&nbsp;&nbsp;&nbsp;&nbsp; \r\n1、请王总明天（9月11日）下午提供数据库设计方案，包括电子表单、用户权限、组织机构、activity相关表，除表结构外还要标清表与表之间的关联关系。</DIV>\r\n<DIV>&nbsp;&nbsp;&nbsp;&nbsp; 2、刘聪负责先整理一份表单流转平台技术方案。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;&nbsp;&nbsp;&nbsp; 看以上完成情况，再安排一次讨论，初步定在本周五下午3点一楼会议室。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;&nbsp;&nbsp;&nbsp; 另外，附上这次项目目前着急要部署的一些应用实例需求。</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV>祝好!</DIV>\r\n<DIV><FONT size=2 face=Verdana></FONT>&nbsp;</DIV>\r\n<DIV align=left><FONT color=#c0c0c0 size=2 face=Verdana>2014-09-10 \r\n</FONT></DIV><FONT size=2 face=Verdana>\r\n<HR style=\"HEIGHT: 2px; WIDTH: 122px\" align=left SIZE=2>\r\n\r\n<DIV><FONT color=#c0c0c0 size=2 face=Verdana><SPAN>刘聪</SPAN> \r\n</FONT></DIV></FONT></DIV></DIV></BODY></HTML>\r\n','2014-09-17 08:20:52','',2052751705,0,'<201409171620522616721@163.com>','support@peisheyun.com'),('10000005730020','2052751705','2014-09-17 08:22:05',NULL,NULL,0,0,'收到一条采购信息','support@peisheyun.com','wangzhiyun999@163.com','﻿<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.0 Transitional//EN\">\r\n<HTML><HEAD>\r\n<META content=\"text/html; charset=UTF-8\" http-equiv=Content-Type>\r\n<STYLE>\r\nBLOCKQUOTE {\r\n	MARGIN-BOTTOM: 0px; MARGIN-LEFT: 2em; MARGIN-TOP: 0px\r\n}\r\nOL {\r\n	MARGIN-BOTTOM: 0px; MARGIN-TOP: 0px\r\n}\r\nUL {\r\n	MARGIN-BOTTOM: 0px; MARGIN-TOP: 0px\r\n}\r\nDIV.FoxDiv20140917162006639102 {\r\n	COLOR: #000000\r\n}\r\nP {\r\n	MARGIN-BOTTOM: 0px; MARGIN-TOP: 0px\r\n}\r\nBODY {\r\n	FONT-SIZE: 10.5pt; FONT-FAMILY: 微软雅黑; COLOR: #000080; LINE-HEIGHT: 1.5\r\n}\r\n</STYLE>\r\n\r\n<META name=GENERATOR content=\"MSHTML 10.00.9200.17088\"></HEAD>\r\n<BODY style=\"MARGIN: 10px\">\r\n<DIV>&nbsp;</DIV>\r\n<DIV>&nbsp;</DIV>\r\n<HR style=\"HEIGHT: 1px; WIDTH: 210px\" align=left color=#b5c4df SIZE=1>\r\n\r\n<DIV><SPAN>wangzhiyun999</SPAN></DIV>\r\n<DIV>&nbsp;</DIV>\r\n<DIV \r\nstyle=\"BORDER-TOP: #b5c4df 1pt 