/thread-94193-1-1.html</a> <br />随堂考试四：<a href=\"http://www.aixchina.net/home/cp.php?ac=examine&amp;step=start&amp;xid=79\">http://www.aixchina.net/home/cp.php?ac=examine&amp;step=start&amp;xid=79</a> <br />第三个方向：虚拟化、云计算<br />【辅导资料】IBM PowerVM 虚拟化管理和监控： <br /><a href=\"http://www.aixchina.net/club/thread-94195-1-1.html\">http://www.aixchina.net/club/thread-94195-1-1.html</a><br />随堂考试五：<a href=\"http://www.aixchina.net/home/cp.php?ac=examine&amp;step=start&amp;xid=75\">http://www.aixchina.net/home/cp.php?ac=examine&amp;step=start&amp;xid=75</a><br />【辅导资料】金融业如何应用虚拟化、云计算（经验分享）:<br />&nbsp;<a href=\"http://www.aixchina.net/club/thread-95475-1-1.html\">http://www.aixchina.net/club/thread-95475-1-1.html</a> <br />随堂考试六：<a href=\"http://www.aixchina.net/home/cp.php?ac=examine&amp;step=start&amp;xid=81\">http://www.aixchina.net/home/cp.php?ac=examine&amp;step=start&amp;xid=81</a></p><p>（目前一共有6门随堂课考试，全部配有辅导资料，您能通过几门？）</p><p><strong><span style=\"font-family:宋体;FONT-SIZE: 9pt; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial\">以上</span><span style=\"font-family:\\\'Arial\\\',\\\'sans-serif\\\';FONT-SIZE: 9pt\">6</span><span style=\"font-family:宋体;FONT-SIZE: 9pt; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial\">门随堂测验，您如果都能通过，那就来参与</span><span style=\"font-family:\\\'Arial\\\',\\\'sans-serif\\\';FONT-SIZE: 9pt\">AIX</span><span style=\"font-family:宋体;FONT-SIZE: 9pt; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial\">高手挑战赛</span><span style=\"font-family:\\\'Arial\\\',\\\'sans-serif\\\';FONT-SIZE: 9pt\">2013</span><span style=\"font-family:宋体;FONT-SIZE: 9pt; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-family: Arial\">年赛</span><span style=\"font-family:\\\'Arial\\\',\\\'sans-serif\\\';FONT-SIZE: 9pt\">60</span><span style=\"font-family:宋体;FONT-SIZE: 9pt; mso-ascii-font-family: Arial; mso-hansi-font-family: Arial; mso-bidi-font-fami